import styled from 'styled-components'
import {OuterContainer, BlogContainer, BlogSmallTitle, BlogBigTitle, BlogCover} from '../components/BlogFolder/BlogPage/BlogElements'

const Blog = () => {
  return (
    <OuterContainer>
      <BlogCover src={require('../content/img/').default}/>
      <BlogSmallTitle>Personal</BlogSmallTitle>
      <BlogBigTitle>Blog</BlogBigTitle>
    </OuterContainer>
  )
}

export default Blog
